import Header from './Header'
import Footer from './Footer'

export default function Layout(props) {
    return (
        <div className="Layout">
            <div className="Header">
                <Header />
            </div>
            <div className="Body">
              <body >
                {props.children}
              </body>
            </div>
            <div className="Footer">
                <Footer />
            </div>
            <style jsx>{`
                .Header {
                  width: 100%;
                  height: 80px;
                  border: 1px solid;
                }

                .Layout {
                    margin: 20px;
                    padding: 20px;
                }

                .Body {
                    border: 1px solid;
                    padding: 20px;
                    display: flex;
                    flex-direction: column;
                    min-height: 100vh;
                }

                .Footer {
                    width: 100%;
                    height: 100px;
                    background-color: red;
                    color: white;
                    text-align: center;
                }
            `}
            </style>
        </div>
    )
}
